import CSVReader from 'react-csv-reader'
import jsonObject from './JSON/CDEContent.json'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        Hi

      </header>
    </div>
  );
}

function createLabel1(label: string) {
    return (
      <section className="labelCard"> 
            <h1>Label: {label}</h1>
            <div className="cards">
                <CDECard></CDECard>
                <CDECard></CDECard>
            </div>
      </section>
    )
}

